INSERT INTO `detalle` (`id`, `id_producto`, `detalle`) VALUES
(1, 1, 'Tecnología a medida de los ángulos característicos, tramite 4 sensores CMOS de peso de 3,2 Kg (7 lbs).\r\n\r\nAlineador de direcciones electrónico para vehículos de turismo y furgonetas, equipado con sistema de medición de los ángulos tramite sensores CMOS y con programas desarrollados sobre plataforma software Windows XP profesional, caracterizado para una interfaz de usuario simple e intuitiva para obtener una eficaz visualización de los datos medidos y de las distintas fases de trabajo con posibilidad de personalizar display y lenguas.\r\n\r\nEl alineador Teco está equipado con 4 medidores CMOS de 3.2 kg de peso, particularmente ligeros y manejables, sistema de transmisión de datos de la unidad central es Wireless vía Radio 2.4 GHz, cuerpo de la máquina movible con ruedas para desplazamiento rápido dentro de la zona de trabajo, banco de datos principal compuesto de más de 20.000 vehículos y software de alineación profesional.'),
(2, 2, 'Elevador de alineación de 4 postes con liberación manual de 5 toneladas\r\n\r\nViene con gatos rodantes y placa de deslizamiento lateral.\r\n\r\nModelo: SXJS5019\r\n\r\nEspecificaciones:\r\n\r\nCapacidad de elevación: 5000Kg\r\n\r\nSegundo, Capacidad de elevación: 2000Kg\r\n\r\nAltura de elevación: 1900mm\r\n\r\nSegundo, Altura de elevación: 350mm\r\n\r\nTiempo de elevación (cargado): 50 s\r\n\r\nTiempo de reducción (cargado): 30 s\r\n\r\nVoltaje de la fuente de alimentación: 220 V, 1 pH o 380 V, pH\r\n\r\nPotencia del Motor: 2.2Kw'),
(3, 3, 'Ventajas de productos:\r\n\r\nInstalación estándar económica, fácil de disfrutar de la conveniencia de la tecnología 3D.\r\n\r\nEl gabinete se puede mover.\r\n\r\nSin compensación de llantas, medición dinámica.\r\n\r\nPara leer los parámetros básicos dentro de 1,5 minutos.\r\n\r\nAgregar funciones extensas sobre la base de parámetros básicos tradicionales.\r\nConfiguración estándar:\r\n\r\nGabinete pequeño y compacto, computadora DELL, pantalla LCD de 20 ″, placas Mini Target, abrazadera de tres dedos, depresor de bloqueo del pedal del freno, fijador del volante, pastillas de cuña, plataforma giratoria de acero, bloque de transición de la plataforma giratoria.\r\n\r\nFunciones básicas:\r\nParámetros de medición tales como inclinación, rueda, inclinación del perno rey, convergencia y retroceso, ángulo de empuje.\r\n\r\nAmplias funciones:\r\n\r\nExtracción del ajuste del neumático (adaptador de llanta de compra), medición de la dimensión del cuerpo.\r\n\r\nAjuste del volante, ajuste del compartimento del motor, medición de la curvatura del dedo del pie (compra de kits de herramientas B5), ajuste del dedo del pie bloqueado.\r\nHaz de cámara móvil manual\r\n\r\nEl nuevo diseño de suspensión trasera tipo deslizante. La altura del haz se puede ajustar libremente en un rango de 80-120 cm o 200-240 cm, adecuado para usar en una variedad de plataformas.'),
(4, 4, 'Elevador de alineación de 4 postes con liberación manual de 5 toneladas\r\n\r\nViene con gatos rodantes y placa de deslizamiento lateral.\r\n\r\nModelo: SXJS5019\r\n\r\nEspecificaciones:\r\n\r\nCapacidad de elevación: 5000Kg\r\n\r\nSegundo, Capacidad de elevación: 2000Kg\r\n\r\nAltura de elevación: 1900mm\r\n\r\nSegundo, Altura de elevación: 350mm\r\n\r\nTiempo de elevación (cargado): 50 s\r\n\r\nTiempo de reducción (cargado): 30 s\r\n\r\nVoltaje de la fuente de alimentación: 220 V, 1 pH o 380 V, pH\r\n\r\nPotencia del Motor: 2.2Kw'),
(5, 5, 'ELEVADOR TIJERA ALINEACIÓN\r\n\r\nMARCA : SUNSHINE(CHINA)\r\n\r\nMODELO : SXJS4021\r\n\r\nCAPACIDAD ELEVACIÓN : 4.000 KG (4 TON)\r\n\r\nALTURA MÁX. ELEVACIÓN : 1.730/2100MM C/JACK\r\n\r\nANCHO TOTAL : 2100MM\r\n\r\nPLATAFORMA ANCHO/LARGO : 600 MM/4500MM\r\n\r\nTIEMPO DE ELEVACIÓN : 80 SEG. AJUSTABLE\r\n\r\nFUENTE DE ALIMENTACIÓN VOLTAJE : 220V / 1 FASE /2.2KW PESO BRUTO : 2000 KG. '),
(6, 6, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(7, 7, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(8, 8, 'El eje principal de alta precisión con un proceso de tratamiento térmico estricto garantiza una precisión de medición repetida. Con función de medición automática de datos.\r\n\r\nEquipado con chipset de alta inteligencia, LCD de 17 \", chip de microcomputadora y función de visualización automática de datos de alta estabilidad. Con auto calibración y funciones de autodiagnóstico.\r\n\r\nDiseño de lujo. Gabinete de máquina más grande con material más grueso. El soporte inferior de acero más grande y más alto puede proteger las virutas internas de la humedad y el frío para que la máquina funcione de manera estable.\r\n\r\nCon 10 modos de balanceo y función OPT. La escala de medición extendida puede medir llantas de 10 \"a 24\". Cabezal de medición de sujeción rápida patentado para pesajes precisos adheridos.\r\n\r\nEl modo de balanceo de adherencia de seguimiento puede ubicar los pesos de manera precisa y rápida, y evitar ajustar la posición repetidamente. Especialmente para equilibrar el nuevo tipo de rueda de clase alta que solo se equilibra con los pesos de adherencia. Medición automática de la distancia y el diámetro de la rueda.\r\n\r\nCon función de división y ocultación de peso. Equipada con capucha protectora, alicates, juegos completos de conos y calibrador. Con el sistema de frenado automático estándar, facilita mucho la operación'),
(9, 9, 'Válvula de seguridad de sobre-presión.\r\n\r\nIncluye dos ruedas y pata de soporte, manilla para fácil traslado ademas de una válvula para drenaje de estanque, con Carter lubricado.\r\n\r\nPresostato automático ON/OFF.\r\n\r\nProtección de seguridad de plástico.\r\n\r\nSeguridad eléctrica comprobada en un 100%'),
(10, 10, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(11, 11, 'Desmontadora semi automática para neumáticos de auto y camionetas desde aro 10\" hasta aro 23\". Accionamiento Electro-Neumático. Incluye estanque acumulador. Plato autocentrante de doble sentido de rotación. Brazo horizontal a bandera de movimiento lateral y bloqueo moral. '),
(12, 12, 'PL-E30 Elevador de tijera pequeño de altura. Es un elevador de tijera empotrado con capacidad de elevación de 3000 KG (6,614 lb).\r\n\r\nAltura mínima de 330 mm, altura de elevación de 2050 mm.\r\n\r\nSistema de bloqueo neumático de seguridad.\r\n\r\nProtección contra sobretensiones.\r\n\r\nPlataforma duradera de una pieza.'),
(13, 13, ' Simplicidad de operación: Nuestro compresor de aire cuenta con un control de plataforma PLC industrial, que puede emplear diferentes modos de operación; Sistema de indicadores en idioma Inglés, fácil de entender. El control automático inteligente y el sistema de auto-diagnóstico de fallos pueden ser ejecutados sin supervisión.\r\n\r\nUnidad de tornillo eficiente: El tornillo principal empleado es original ROTORCOMP, que garantiza estabilidad y alta eficiencia.\r\n\r\nAvanzada disposición: La disposición optimiza la tasa de aprovechamiento del equipo hasta en un 80%.'),
(14, 14, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(15, 15, 'El equipo Sunshine es un excelente equipo relación precio calidad. Cámara 3D alineación-Basado en el coche y no influenciado por la plataforma.\r\n\r\nNo hay líneas de conexión en el disco de destino (target). Medición de progreso, sin necesidad de compensar anillo de acero, la compensación excéntrico preciso será sólo una vez al tirar o empujar el coche hacia atrás y adelante. Sistema Software fácil de operar y completar parámetros convencionales básicos entre ellos, mucho más rápido que los alineadores convencionales. Mantenimiento diario con facilidad. '),
(16, 16, 'Torno manual para auto camioneta hasta 350mm de diámetro de disco, fácil de operar e ideal para talleres, usa aceite 80W90 (no incluido en equipo).\r\n\r\nEl eje se utiliza con la avanzada de frecuencia variable y velocidad ajustable, se puede lograr sin escalonamientos de velocidad de regulación 30-130r/min.\r\n\r\nTodas las operaciones son controladas por las perillas, permitiendo al operario un mayor control del proceso. '),
(17, 17, 'La plataforma elevadora de tijera de capacidad media es el elevador sobre el suelo perfecto para aquellos clientes con restricciones de altura del techo y la necesidad de “elevaciones suficientes” para levantar camionetas.\r\n\r\nEste elevador de tijera de altura completa PULI también es perfecto para aquellos talleres de servicio que desean evitar el aspecto abarrotado de docenas de columnas de elevadores verticales.'),
(18, 18, 'El equipo Shunshine es un excelente equipo\r\n\r\n* Equipo fabricado en China.\r\n\r\n*Garantía del equipos 1 año contra fallas relación precio calidad. Este equipo permite ser utilizado en talleres de vehículos en general, cuenta con sistema de destrabe simultaneo de seguridad, bomba hidráulica . '),
(19, 19, NULL),
(20, 20, 'Elevador electro hidráulico de 2 columnas para 4 Ton. máxima de carga y hasta 1800 mm de altura de trabajo, ideal para talleres mecánicos pequeños o grandes, o para iniciarse en el rubro y para realizar todo tipo de trabajos, desde un cambio de aceite hasta mecánica más dura como sacar cajas de cambio, sistema de escapes, coronas, etc.'),
(21, 21, NULL),
(22, 22, 'Desmontadora Automática, capacidad aro interno 13 - 24\", capacidad aro externo 11\" - 22\", fuerza destalonador 2500kg. Alimentación eléctrica 220v.\r\n\r\nPresión de servicio 8-10 bar. Velocidad de rotación 8Rpm. Peso del equipo 270kg Incluye estanque acumulador TI. '),
(23, 23, NULL),
(24, 24, NULL),
(25, 25, NULL),
(26, 26, 'Liberación manual desde un lado, simplemente opere la manija en el lado de la columna principal para liberar el bloqueo de seguridad. Equipe el interruptor de límite de altura para garantizar la altura de elevación de manera segura, evitando que se dañe el techo del vehículo. '),
(27, 27, 'El eje principal de alta precisión con un proceso de tratamiento térmico estricto garantiza una precisión de medición repetida. Con la función de medición automática de datos. Equipado con chipset de alta inteligencia, pantalla de segmento LED, chip de microcomputadora y función de visualización automática de datos de alta estabilidad. Con auto calibración y funciones de autodiagnóstico. Diseño de lujo. Gabinete de máquina más grande con material más grueso. El soporte inferior de acero más grande y más alto puede proteger las virutas internas de la humedad y el frío para que la máquina funcione de manera estable.\r\n\r\nCon 10 modos de balanceo y función OPT. La escala de medición extendida puede medir llantas de 10 \"a 24\". Cabezal de medición de sujeción rápida patentado para pesajes precisos adheridos 2. Equipada con capucha protectora, alicates, juegos completos de conos y calibrador. '),
(28, 28, ' Desmontadora para auto/camioneta semi automática, fácil de manipular e ideal para iniciar en el rubro de vulcanización, también para iniciar en talleres de cambio de neumáticos o ventas de llantas.\r\n\r\n*Desmontadora semi automática\r\n\r\n*Capacidad aro interno: 12\"-22\".\r\n\r\n*Capacidad aro externo: 10\"-19\".\r\n\r\n*Fuerza destalonador: 2.500 kg.\r\n\r\n*Alimentación eléctrica: 220 volts.\r\n\r\n*Presión de servicio 8-10 bar.\r\n\r\n*Velocidad de rotación 8 Rpm.\r\n\r\n*Peso del equipo 170 Kg '),
(29, 29, ' La desmontadora con brazo auxiliar es ideal para llantas perfil bajo o neumáticos run flat y adecuado para automóviles y camionetas.\r\n\r\nEl brazo 098 (montado en el lado derecho) realiza casi las mismas funciones que los brazos dobles. '),
(30, 30, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(31, 31, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos. '),
(32, 32, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(33, 33, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(34, 34, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
(35, 35, 'Alineador de direcciones electrónicos con tecnología de medida, tramite 2 tele-cameras digitales con programas desarrollados sobre plataforma software Windows 7 ultímate y concebido para trabajar sobre vehículos de turismo y furgonetas.'),
(36, 36, 'Elevador Electro Hidráulico, Cuatro columnas, Peso Máximo 4,0 Ton.\r\n\r\nIdeal para trabajos de inspección y reparación de tren delantero, carrocería, caños de escapes, cambio de aceite y mecánica en general.\r\n\r\nSus plataformas permiten el acceso de todo tipo de vehículos.\r\n\r\nSistema de trabas de seguridad combinadas en las cuatro columnas, permitiendo el bloqueo a cualquier altura, con alarma sonora que garantiza máxima seguridad en el desbloqueo.\r\n\r\nPosee poleas de gran diámetro y cables de acero con alma textil.\r\n\r\nDiseñado para ser utilizado como rampla de alineación, además de poder ser instalados sus platos giratorios y deslizantes.'),
(37, 37, '1. La altura mínima es de solo 110 mm, adecuada para instalación en tierra\r\n\r\n2. La longitud de la plataforma principal es 1500 mm, extendida hasta 2080 mm.\r\n\r\n3. Sellos hidráulicos importados, todo el sistema es confiable; brazos de tijera utilizan acero internacional estándar sólido Q345, deformación permanente.\r\n\r\n4. La altura máxima es de 1000 mm, el estante dedicado dedicado opcional, satisface las diferentes necesidades del cliente  .\r\n\r\nDiseñado especialmente adecuado para servicio rápido de neumáticos y reparación rápida de vehículos\r\n\r\nEl diseño de protección para los pies y el control de voltaje de 24 V, proporcionan una protección integral\r\n\r\nEl diseño general es muy adecuado para el reemplazo rápido de neumáticos y aceite de motor. '),
(38, 38, 'Para elevador tijera PL-C55.\r\n\r\nIndispensable para alineación y cambio de ruedas, reparación de frenos, suspensión, etc.\r\n\r\nAl elevar las dos ruedas del mismo eje.\r\n\r\nBrazos y calzos adaptables al vehículo. Gran robustez. '),
(39, 39, 'Elevador tipo tijera para inspección y mecánica en general, para ser instalado bajo suelo lo que permite mayor espacio de desplazamiento al taller al no estar ocupados '),
(40, 40, 'Elevador electro hidráulico tipo tijera para alineación, cuenta con una segunda plataforma de elevación dentro de la plataforma central la cual permite realizar trabajos de cambio de neumáticos, frenos, etc., al no contar con Jack central mejora la prestancia de trabajos a realizar como mecánica más dura, puede ir sobre suelo o bajo suelo con obra civil adecuada.\r\n\r\nElevador electro hidráulico sobre piso para trabajos de inspección o mecánica en general, ideal para talleres con poco espacio y altura. '),
(41, 41, 'Diseño de dientes de seguridad de doble cara mecanizados con precisión.\r\n\r\nParada descendente de seguridad y alarma.\r\n\r\nVálvula de seguridad para anti-explosión del sistema hidráulico.\r\n\r\nInterruptor de límite de altura.\r\n\r\nPlacas antideslizantes resistentes a la abrasión para la alineación de las 4 ruedas.\r\n\r\nGata central no va incluida'),
(42, 42, 'Con una de 1000 libras. capacidad de elevación, la plataforma de elevación de motocicletas PL-MT04 brinda facilidad profesional para cualquier trabajo de servicio de motocicletas o vehículos todo terreno.\r\n\r\n1) Este es un elevador de motocicleta ideal para un servicio rápido. Disponible para uso en interiores o exteriores con capacidad de elevación de 452 KG.\r\n\r\n2) Altura mínima de 180 mm, altura máxima de 780 mm.\r\n\r\n3) Fácil elevación con pedal.\r\n\r\n4) Abrazadera de rueda delantera equipada.'),
(43, 43, 'PL-B30Y El elevador de tijera de plataforma completa de elevación pequeña de capacidad es el elevador sobre el suelo perfecto para aquellos clientes con restricciones de altura del techo y la necesidad de \"elevaciones suficientes\" para elevar las autos / camionetas.\r\n\r\nEste elevador de tijera de altura completa PULI también es perfecto para aquellos talleres de servicio que desean evitar el aspecto abarrotado de docenas de columnas de elevadores verticales.\r\n\r\n1) Este es un elevador de tijera de bajo perfil montado en la superficie plug-n-play con capacidad de elevación de 3000 KG.\r\n\r\n2) Altura mínima de 105 mm, altura de elevación de 1850 mm.\r\n\r\n3) Plataforma duradera de una pieza. Mejore la estructura del cuerpo hace que las rampas de plataforma y de la persiana sean más fuertes y estables.\r\n\r\n4) Sistema de bloqueo de seguridad neumático.\r\n\r\n5) Protección contra sobretensiones.\r\n\r\n6) Las plataformas se extienden hasta 2050 mm.'),
(44, 44, 'Este es un elevador de tijera portátil montado en superficie con capacidad de elevación de 3000 kg.\r\n\r\nDoble seguridad al estar equipado con bloqueo hidráulico y bloqueo mecánico de doble engranaje con garra de seguridad.\r\n\r\nEste elevador de tijera de altura completa PULI también es perfecto para aquellos talleres de servicio que desean evitar el aspecto abarrotado de docenas de columnas de elevadores verticales. '),
(45, 45, 'Capacidad aro interno 22\", Capacidad aro externo 12\", Diámetro Máximo 41\", Ancho Neumático 14\", Fuerza destalonador 2500kg, Alimentación Eléctrica 220 v, Presión de servicio 8-10 bar, Velocidad de rotación 8Rpm, Peso del equipo 210kg. '),
(46, 46, ' Desmontadora semi automática para Neumáticos de auto y camionetas desde aro 10\" hasta aro 23\".\r\n\r\nAccionamiento Electro-Neumático Incluye estanque acumulador Plato autocentrante de doble sentido de rotación Brazo horizontal a bandera de movimiento lateraly bloqueo moral '),
(47, 47, 'Desmontadora Automática, capacidad aro interno 13 - 24\", capacidad aro externo 11\" - 22\", fuerza destalonador 2500kg. Alimentación eléctrica 220v.\r\n\r\nPresión de servicio 8-10 bar. Velocidad de rotación 8Rpm. Peso del equipo 270kg Incluye estanque acumulador TI. '),
(48, 48, 'Peso neto UPH 66KG. Peso neto UPH + BPS 72KG. Peso neto UPH + KIT PAX 98kg. Presión de servicio 7-10 bar '),
(49, 49, NULL),
(50, 50, 'ESPECIFICACIONES TÉCNICAS -Diámetro interno: 14\" - 26\" -Diámetro externo: 1600mm -Motor voltaje: 220v / 1.5 KW -Fuerza destolonadora: 2500 Kg -Peso neto: 500 kg -Tamaño del paquete:2000x1580x950mm -Sistema motor hidrahulico -Operacion electro-hidrahulica '),
(51, 51, 'Desmontadora electro-hidráulica para ruedas con y sin cámara de aire de camiones y autobuses de diámetro máximo 1600mm y máxima anchura 780mm. El mandril auto-entrante bloquea llantas de canal o de arillo desde 14\" hasta 26\"'),
(52, 52, 'Desmontadora electro-hidráulica para ruedas con y sin cámara de aire de camiones y autobuses de diámetro máximo 2300mm y máxima anchura 1065mm. El mandril auto-entrante bloquea llantas de canal o de arillo desde 14\" hasta 46\". '),
(53, 53, 'Desmontadora automática concebida para los profesionales del sector e ideal para operar sobre ruedas de turismo y furgonetas de llanta 10\" a 25\".\r\n\r\nTiene una particular robustez y fiabilidad, y pedales extraíbles a cajón para facilitar las operaciones de mantención.'),
