(60, 60, 'Rápida, precisa y eficiente para cortar el rotor.\r\n\r\nEl ajuste rápido y lento permite cortar el rotor.\r\n\r\nRápido, preciso y eficiente para cortar el tambor.\r\n\r\nLa configuración finitamente ajustable permite cortar el tambor.\r\n\r\nTres tipos de velocidad a elegir para la velocidad del eje.\r\n\r\nPaquete adaptador totalmente equipado.\r\n\r\nUn diseño práctico permite cambiar rápidamente del rotor al tambor.\r\n\r\nLa posición de parada hace que el torno se detenga automáticamente después del corte'),
