(65, 65, 'Alineador de direcciones electrónico para vehículos pesados y, (utilizando accesorios opcionales especíﬁcos), coches y furgonetas con programas desarrollados sobre plataforma software Windows XP Professional.\r\n\r\nConcebido para los profesionales del sector, el alineador TECO 814 TRUCK está equipado con 4 medidores de 8 sensores CCD, sistema de transmisión datos «wireless», cuerpo máquina movible, trámite ruedas para desplazamiento rápido dentro de la zona de trabajo, banco de datos principal compuesto de más de 3.000 vehículos y software de alineación profesional para camiones de 2 ejes, de 3 ejes con eje de tracción central o carro central, de 4 ejes y para remolques y semirremolques.'),
(66, 66, 'Balanceadora con pantalla display, los valores son ingresados de forma manual, el posee programa para contrapeso escondido, programa para auto calibración, peso maximo de rueda 65 kilos Baja velocidad de balanceo, reduciendo el desgaste de sus piezas y partes, programa de balanceo dinámico y estático, con accesorios opcionales se puede balancear ruedas de motos.'),
